import React from "react";
import { Link, NavLink } from "react-router-dom";
import "./Navbar.css";

function Navbar({ user, onLogout }) {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <NavLink to="/home" className={(navData) => (navData.isActive ? "active-style" : 'none')}>
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="/configuration" className={(navData) => (navData.isActive ? "active-style" : 'none')}>
            Configuration
          </NavLink>
        </li>
        {!user ? (
          <>
            <li>
              <NavLink to="/login" className={(navData) => (navData.isActive ? "active-style" : 'none')}>
                Login
              </NavLink>
            </li>
            <li>
              <NavLink to="/registration" className={(navData) => (navData.isActive ? "active-style" : 'none')}>
                Registration
              </NavLink>
            </li>
          </>
        ) : (
          <li>
            <button onClick={onLogout}>Logout</button>
          </li>
        )}
      </ul>
    </nav>
  );
}

export default Navbar;
